import React, { useState, useMemo } from 'react';
import useProfileStore from '../../stores/profileStore';
import Table from '../common/Table';
import Button from '../common/Button';
import './MasterList.scss';

function MasterList() {
  const {
    profiles,
    deleteProfiles,
    getFilteredProfiles
  } = useProfileStore();

  const [selectedIds, setSelectedIds] = useState([]);
  const [statusFilter, setStatusFilter] = useState('all');
  const [searchQuery, setSearchQuery] = useState('');
  const [sortColumn, setSortColumn] = useState(null);
  const [sortDirection, setSortDirection] = useState(null);

  const handleSort = (key, direction) => {
    setSortColumn(key);
    setSortDirection(direction);
  };

  const handleDelete = (id) => {
    deleteProfiles([id]);
    setSelectedIds(selectedIds.filter(selectedId => selectedId !== id));
  };

  const handleBulkDelete = () => {
    if (selectedIds.length > 0) {
      deleteProfiles(selectedIds);
      setSelectedIds([]);
    }
  };

  const formatDate = (dateString) => {
    if (!dateString) return '-';
    const date = new Date(dateString);
    return date.toLocaleDateString('en-US', {
      month: 'short',
      day: 'numeric',
      year: 'numeric'
    });
  };

  const filteredProfiles = useMemo(() => {
    let result = profiles;

    if (statusFilter !== 'all') {
      result = result.filter(profile => profile.status === statusFilter);
    }

    if (searchQuery) {
      const query = searchQuery.toLowerCase();
      result = result.filter(profile => 
        profile.username.toLowerCase().includes(query)
      );
    }

    return result;
  }, [profiles, statusFilter, searchQuery]);

  const columns = [
    {
      key: 'username',
      title: 'Username',
      sortable: true,
      render: (profile) => (
        <a 
          href={`https://instagram.com/${profile.username}`}
          target="_blank"
          rel="noopener noreferrer"
        >
          {profile.username}
        </a>
      )
    },
    {
      key: 'status',
      title: 'Status',
      sortable: true,
      render: (profile) => profile.status
    },
    {
      key: 'lastChecked',
      title: 'Last Check',
      sortable: true,
      render: (profile) => formatDate(profile.lastChecked)
    },
    {
      key: 'lastDetected',
      title: 'Last Story',
      sortable: true,
      render: (profile) => formatDate(profile.lastDetected)
    },
    {
      key: 'totalChecks',
      title: 'Checks',
      sortable: true,
      render: (profile) => profile.totalChecks || 0
    },
    {
      key: 'totalDetections',
      title: 'Stories',
      sortable: true,
      render: (profile) => profile.totalDetections || 0
    },
    {
      key: 'actions',
      title: '',
      render: (profile) => (
        <Button
          variant="danger"
          size="small"
          onClick={() => handleDelete(profile.id)}
          data-testid="delete-button"
        >
          X
        </Button>
      )
    }
  ];

  return (
    <div className="master-list">
      <div className="master-list__header">
        <div className="master-list__filters">
          <input
            type="text"
            value={searchQuery}
            onChange={(e) => setSearchQuery(e.target.value)}
            placeholder="Search usernames..."
            className="master-list__search"
          />
          <select
            value={statusFilter}
            onChange={(e) => setStatusFilter(e.target.value)}
            className="master-list__filter"
          >
            <option value="all">All Status</option>
            <option value="active">Active</option>
            <option value="inactive">Inactive</option>
          </select>
        </div>
        {selectedIds.length > 0 && (
          <Button
            variant="danger"
            onClick={handleBulkDelete}
            data-testid="bulk-delete-button"
          >
            Delete ({selectedIds.length})
          </Button>
        )}
      </div>

      {!filteredProfiles.length ? (
        <div className="master-list__empty">
          <p>No profiles found</p>
        </div>
      ) : (
        <Table
          data={filteredProfiles}
          columns={columns}
          onSort={handleSort}
          sortColumn={sortColumn}
          sortDirection={sortDirection}
          pageSize={100}
          selectable={true}
          selectedRows={selectedIds}
          onSelectionChange={setSelectedIds}
        />
      )}
    </div>
  );
}

export default MasterList;
